--------------------------------------------------\r\nANDRE ROSMANINHO RUELA[105] - R. - <andreruela@prodemge.gov.br> em 30/12/2011 14:05\r\nInserir no atendimento informações relativas a tentativas e/ou contato com cliente, e testes realizados.\r\n\r\n--------------------------------------------------\r\nANDRE ROSMANINHO RUELA[105] - R. - <andreruela@prodemge.gov.br> em 30/12/2011 14:05 Repasse\r\nContinuar no Fluxo, Etapa ''GAT - Nivel 2 - Atendimento'' finalizada com status : Responsabilidade da Operadora / Encaminhar Atendimento para NOC da Operadora.Entrada etapa ''NOC da Operadora / Atendimento encaminhado''. Responsável Grupo definido pela formula : Verificar o NOC da Operadora.\r\n--------------------------------------------------\r\nHERNAN MARTINS ALVES[1718] - R. - <hernan@vodanet-telecom.com> em 30/12/2011 14:57\r\n     Foi realizado contato com Erika Damásio, onde foi informado que na localidade não houve queda de energia,ninguém desligou o equipamento no período de 10:00 horas a 14:45 e na localidade não teve chuva.\r\n     Foi realizado análise histórico de logs do sinal da vsat do dia 30/11/12, comprovando que não houve nenhuma queda do sinal.\r\n     A IDU foi acessa para busca de status, aonde foi verificada que não houve queda.\r\n\r\n--------------------------------------------------\r\nHERNAN MARTINS ALVES[1718] - R. - <hernan@vodanet-telecom.com> em 30/12/2011 14:57\r\nAPRESENTOU UMA SOLUÇÃO para a ocorrência (vide campo Solução)\r\n--------------------------------------------------\r\nHERNAN MARTINS ALVES[1718] - R. - <hernan@vodanet-telecom.com> em 30/12/2011 14:57 Repasse\r\nCONCLUSÃO, Etapa ''NOC da Operadora / Atendimento encaminhado'' finalizada com status : Não é respons. da Operadora/Repassar atendimento de volta para GAT - Nivel 2 - Atendimento.Entrada etapa ''GAT - Nivel 2 - Atendimento''. Responsável Grupo definido pela formula : GAT - Nivel 2 - Atendimento (Workflow Rede Governo).\r\n--------------------------------------------------