overno).', 3, 72, 24, 100, 'Realizado contato com o numero:(35) 3537-1638,em contato com o atendente Jucelino, informou a ocorrencia de huva muito forte, com pico de energia, na localidade.\n\nDe acordo com o relato fecho o agilis como causa cliente.', 2, 0),
