(131, NULL, 'Atendimento iniciado por Verônica Bruna Barroso as 19:05 de 23/01/2012\n\n\n\n-------------------------------------\nJOSE MARIA LIMA DOS SANTOS[1126] - R. - <josemaria@prodemge.gov.br> em 20/01/2012 21:30\nAPRESENTOU UMA SOLUÇÃO para a ocorrência (vide campo Solução)\n--------------------------------------------------\nJOSE MARIA LIMA DOS SANTOS[1126] - R. - <josemaria@prodemge.gov.br> em 20/01/2012 21:31 Repasse\nContinuar no Fluxo, Etapa ''GAT - Nivel 2 - Atendimento'' finalizada com status : Responsabilidade da Operadora / Encaminhar Atendimento para NOC da Operadora.Entrada etapa ''NOC da Operadora / Atendimento encaminhado''. Responsável Grupo definido pela formula : Verificar o NOC da Operadora.\n--------------------------------------------------\nJOSE MARIA LIMA DOS SANTOS[1126] - R. - <josemaria@prodemge.gov.br> em 20/01/2012 21:34\nFAVOR VERIFICAR A SOLICITACAO ABAIXO :\n\n\n\nDe: Hernán Martins Alves [mailto:hernan@vodanet-telecom.com] \nEnviada em: sexta-feira, 20 de janeiro de 2012 19:35\nPara: atendimento@prodemge.gov.br\nCc: ''Alex Castillo''\nAssunto: Mudança Crítica - SES-JURA-0649\n\nPrezados,\n\nSolicitamos uma janela de mudança em ergencial crítica para o dia 23/01/2012, no horário comercial, na Localidade SES-JURA-0649, para a reparo de equipamentos. Sem esta reparo, o link ficará inoperante.\n\nSolicitante: Vodanet Telecom\nResumo: Ocorrência no modem do cliente.\nJustificativa: Curto circuito nos cabos, e só pode ser no horário comercial, por que o cliente não permite a relação fora desse horario.\nPrioridade: Alta\nData e Hora: 23/01/2012 das 07:00 às 19:00h\nComponentes: Modem instalado no cliente\nAcessos: SES-JURA-0649\nEndereço: Avenida Eugenio do Nascimento, 0 HOSPITAL UNIVERSITARIO - Dom Bosco - Juiz de Fora.\nPrevisão de Interrupção: 23/01/2012 das 07:00 às 19:00h\nPlano de Retorno: 23/01/2012 as 19:00h\nHernán Martins Alves\n(31) 3339-1225\n(31) 9208-0589\nVodanet Telecomunicações Ltda\nhttp://www.vodanet-telecom.com\n\n\n--------------------------------------------------\nOLIVAN NEVES RANGEL MACHADO[1668] - R. - <noc@vodanet-telecom.com> em 23/01/2012 19:04\nReparo realizado com sucesso, Link operante.\n--------------------------------------------------\nOLIVAN NEVES RANGEL MACHADO[1668] - R. - <noc@vodanet-telecom.com> em 23/01/2012 19:04\nAPRESENTOU UMA SOLUÇÃO para a ocorrência (vide campo Solução)', 3, 78, 24, 127, 'Prezados,\n\nSolicitamos uma janela de mudança em ergencial crítica para o dia 23/01/2012, no horário comercial, na Localidade SES-JURA-0649, para a reparo de equipamentos. Sem esta reparo, o link ficará inoperante.', 2, 0),
(132, NULL, 'Atendimento iniciado por Olivan Machado as 07:57 de 24/01/2012\r\n\r\n------------------------------------------------------------------------------------------\r\n\r\nTodos os links se encontram Operante.\r\nReferente ao Cluster 0670 foi feito mais de três tentativas de contato com o tel. (34)3265-1101, sem sucesso.\r\nCluster 0754,0750 foi feito de contato por telefone sem sucesso. Foram enviados técnicos nos locais onde os dois locais se encontraram fechados sem ninguém para receber os técnicos.\r\nReferente aos cluster 0670,0754 e 0750 a Causa: Cliente. Aos demais Causa: Operadora\r\n\r\n\r\n', 3, 65, 10, 128, 'Todos os links se encontram Operante.\nReferente ao Cluster 0670 foi feito mais de três tentativas de contato com o tel. (34)3265-1101, sem sucesso.\nCluster 0754,0750 foi feito de contato por telefone sem sucesso. Foram enviados técnicos nos locais onde os dois locais se encontraram fechados sem ninguém para receber os técnicos.\nReferente aos cluster 0670,0754 e 0750 a Causa: Cliente. Aos demais Causa: Operadora', 2, 0),
