(166, '2012-02-01 08:14:59', 'OLIVAN = Feito contato no local as 08:19 mas não houve sucesso,  tom de ocupado.\n\nOLIVAN = Feito contato no local as 08:30 onde Bianca pediu para retorna a ligação para numero \n               (32) 84727672 para verificar status do modem na Farmacia.\n               Feito contato no numero 84727672, fora de area de corbertura.\n               Bianca retornou a ligação informando que o modem esta com luz de erro ligada e a \n               luz do trasmiter apagada, chuva forte na localidade no dia de 31/01 com queda de energia, \n               feito desligamento e da idu na tomada e religado link normalizado.', 3, 46, 10, 148, 'Feito contato no local onde Bianca Maria informou quedas de energia na localidade a partir do 31/01/2012 por for forte chuva deixando a IDU desligada por falta de energia elétrica causando paralisação do link.\n\nLink normalizado após estabelecimento da energia e dos equipamentos.\n\nCausa: Não  e responsabilidade da Operadora.\n', 2, 0),
(167, '2012-02-01 08:23:52', 'OLIVAN= Feito contato no local as 08:25 sem sucesso, ninguem atendeu.\n\nOLIVAN= Feito Contato no local com Estela onde informou pico de energia no dia 31/01 e foi verificadno no modem que a luz do tx estava apagada e a luz de erro piscando, Foi feito desligamento da IDU na tomada . link normalizado\n\n(vazio)\n\n <b>Verônica Bruna Barroso, 16/03/2012 12:12:33</b> - Finalizado', 3, 57, 10, 149, 'Feito contato no local onde Estela informou quedas de energia na localidade a partir do 31/01/2012 por chuva deixando a IDU desligada por falta de energia elétrica causando paralisação do link.\n\nLink normalizado após estabelecimento da energia e dos equipamentos.\n\nCausa: Não  e responsabilidade da Operadora.\n', 2, NULL),
