(227, '2012-02-16 09:25:46', 'NOC BH OLIVAN: Feito contato com Marilene onde informou que não houve queda energia,Desligamento da IDU e chuva intensa no local, informou que luz de tx apagada.\n\nNOC BH OLIVAN: Feito contato Com Bruno Noc SP para verificar problema ocorrido.\n\n\nNOC Vodanet Bruno: Analisamos o terminal e constatamos que a ODU apresenta erros de diseqc, solicitamos que seja enviado um tecnico para a localidade para analisar os cabos de RX e TX e o BUC.\n\nNOC BH OLIVAN: Foi encaminhado para Cordenação BH solicitação agendamento Tecnico.\n\nNOC BH OLIVAN: Foi agendado visita técnica com Viviane no horario de até as  16:00 horas no dia de hoje (16/02/2012), \n\nNOC BH OLIVAN: Foi passado para técnico Airton o chamado e informações sobre incidente. \n                          STATUS: Técnico a  Caminho.\n\n', 3, 22, 10, 176, '08:44 - Feito contato com Marilene onde informou que não houve queda energia,Desligamento da IDU e chuva intensa no local. \n--------------------------------------------------\n10:50 - Foi enviado técnico na localidade para verificar possíveis falha no equipamento.\n--------------------------------------------------\n\nVeronica:--------------------------------------------------\n16/02/2012 17:51\nDe acordo com a vistoria realizada, constatamos que o local onde foi instalada a antena, \n\ncom aval do responsavel pelo posto, encontarvasse encoberto por capim atrapalhando a transmição e recepção do sinal. \n\nCausa Cliente', 2, 0),
