(556, '2012-04-16 14:17:55', 'Atendimento iniciado por Olivan Machado as 14:17 de 16/04/2012\n\nTentativa de contato na localidade, sem sucesso.\n\n <b>Olivan Machado, 16/04/2012 14:19:19</b> - Finalizado', 3, 5, 10, 385, 'Tentativa de contato na localidade, sem sucesso.', 2, NULL),
(557, '2012-04-16 14:17:40', '\n\nManutenção na localidade para link que está caindo continuamente. Provaveis problemas são buc e rede eletrica da localidade.\n\n <b>Hernan - Supervisor, 16/04/2012 14:18:26</b> - Aberto\n\n(vazio)\n\n <b>Hernan - Supervisor, 16/04/2012 14:18:45</b> - Aberto\n\nAirton estve no local onde constatou que o problema estava na tomada do cliente. O responsável pelo local enviará um email informando o acontecido que será enviado para a Prodemge, para que os incidentes do período sejam desconsiderados.\n\n <b>Hernan - Supervisor, 18/04/2012 10:34:17</b> - Aberto\n\n(vazio)\n\n <b>Hernan - Supervisor, 18/04/2012 10:34:28</b> - Finalizado', 3, 138, 14, 323, 'Sem Agilis. Janela de manutenção solicitada no dia 13/04 por email.\n\nAirton estve no local onde constatou que o problema estava na tomada do cliente. O responsável pelo local enviará um email informando o acontecido que será enviado para a Prodemge, para que os incidentes do período sejam desconsiderados.', 1, NULL),
(558, '2012-04-16 14:18:45', '\n\nCom o auxílio do técnico Airton, foi constatada falha na instalação, mais precisamente na rede elétrica da tomada onde o modem estava ligado. De qualquer forma, no decorrer do atendimento houve troca da ODU e do modem. \nAté o momento, a VSAT permanece online.\n\nJefferson Marques - NOC SÃO PAULO.\n\n <b>Jefferson Marques, 16/04/2012 18:21:35</b> - Em atendimento\n\n(vazio)\n\n <b>Jefferson Marques, 16/04/2012 18:27:55</b> - Finalizado', 3, 138, 9, 323, '-', 2, 557),
