CREATE ALGORITHM=UNDEFINED DEFINER=`vodanettel_4`@`%` SQL SECURITY DEFINER VIEW `listatendimentos` AS select `a`.`idatend_vsat` AS `idatend_vsat`,`a`.`incidentes_idincidentes` AS `idincidentes`,(select `municipios`.`municipio` from `municipios` where (`municipios`.`idmunicipios` = (select `os`.`municipios_idcidade` from `os` where (`os`.`idos` = (select `instalacoes`.`os_idos` from `instalacoes` where (`instalacoes`.`idinstalacoes` = `a`.`instalacoes_idinstalacoes`)))))) AS `localidade`,(select `instalacoes`.`nome` from `instalacoes` where (`instalacoes`.`idinstalacoes` = `a`.`instalacoes_idinstalacoes`)) AS `nome_vsat`,'Prodemge' AS `hub`,(select `usuarios`.`nome` from `usuarios` where (`usuarios`.`idusuarios` = `a`.`usuarios_idusuarios`)) AS `usuario`,(select `status_atend`.`status` from `status_atend` where (`status_atend`.`idstatus_atend` = `a`.`status_atend_idstatus_atend`)) AS `status`,(select `cronometro`.`inicio_tarefa` from `cronometro` where ((`cronometro`.`tabelareferencia` = 'atend_vsat') and (`cronometro`.`idreferencia` = `a`.`idatend_vsat`))) AS `inicio`,(select `cronometro`.`final_tarefa` from `cronometro` where ((`cronometro`.`tabelareferencia` = 'atend_vsat') and (`cronometro`.`idreferencia` = `a`.`idatend_vsat`))) AS `fim`,(select timediff((select if(isnull((select `cronometro`.`final_tarefa` from `cronometro` where ((`cronometro`.`tabelareferencia` = 'atend_vsat') and (`cronometro`.`idreferencia` = `a`.`idatend_vsat`)))),now(),(select `cronometro`.`final_tarefa` from `cronometro` where ((`cronometro`.`tabelareferencia` = 'atend_vsat') and (`cronometro`.`idreferencia` = `a`.`idatend_vsat`))))),(select `cronometro`.`inicio_tarefa` from `cronometro` where ((`cronometro`.`tabelareferencia` = 'atend_vsat') and (`cronometro`.`idreferencia` = `a`.`idatend_vsat`))))) AS `tempo_passado` from `atend_vsat` `a` where (((select `cronometro`.`inicio_tarefa` from `cronometro` where ((`cronometro`.`tabelareferencia` = 'atend_vsat') and (`cronometro`.`idreferencia` = `a`.`idatend_vsat`))) is not null) and ((select `cronometro`.`inicio_tarefa` from `cronometro` where ((`cronometro`.`tabelareferencia` = 'atend_vsat') and (`cronometro`.`idreferencia` = `a`.`idatend_vsat`))) <> '')) order by `a`.`idatend_vsat` desc;

