--
-- Estrutura para visualizar `listchamadosfull`
--
DROP TABLE IF EXISTS `listchamadosfull`;

CREATE ALGORITHM=UNDEFINED DEFINER=`vodanettel_4`@`%` SQL SECURITY DEFINER VIEW `listchamadosfull` AS select `a`.`idatend_vsat` AS `idatendimento`,`a`.`data` AS `atendimento`,(select if((`a`.`incidentes_idincidentes` = 0),'Sem Incidente',`a`.`incidentes_idincidentes`)) AS `incidente`,(select `instalacoes`.`nome` from `instalacoes` where (`instalacoes`.`idinstalacoes` = (select `incidentes`.`instalacoes_idinstalacoes` from `incidentes` where (`incidentes`.`idincidentes` = `a`.`incidentes_idincidentes`)))) AS `vsat`,`u`.`nome` AS `tecnico`,`u`.`idusuarios` AS `idtecnico`,(select `perfis`.`perfil` from `perfis` where (`perfis`.`idperfis` = `u`.`perfis_idperfis`)) AS `perfil_usuario`,(select if((`u`.`perfis_idperfis` = 5),`u`.`subperfil_idsubperfil`,`u`.`perfis_idperfis`)) AS `idperfil_usuario`,`u`.`empresas_idempresas` AS `empresa`,`s`.`status` AS `status`,(select if(((`a`.`resposta_agilis` <> '') and (`a`.`resposta_agilis` is not null)),1,0)) AS `resposta_agilis`,(select timediff(if(isnull(`c`.`final_tarefa`),now(),`c`.`final_tarefa`),`c`.`inicio_tarefa`)) AS `tempo_vencimento`,`c`.`inicio_tarefa` AS `data_inicio`,(select if(isnull(`c`.`final_tarefa`),'',`c`.`final_tarefa`)) AS `data_fim`,`c`.`final_tarefa` AS `fim_cronometro` from (((((`atend_vsat` `a` left join `incidentes` `i` on((`i`.`idincidentes` = `a`.`incidentes_idincidentes`))) left join `instalacoes` `inst` on((`inst`.`idinstalacoes` = `i`.`instalacoes_idinstalacoes`))) left join `usuarios` `u` on((`u`.`idusuarios` = `a`.`usuarios_idusuarios`))) left join `status_atend` `s` on((`s`.`idstatus_atend` = `a`.`status_atend_idstatus_atend`))) left join `cronometro` `c` on(((`c`.`idreferencia` = `a`.`idatend_vsat`) and (`c`.`tabelareferencia` = 'atend_vsat')))) where ((`a`.`incidentes_idincidentes` <> 0) and ((select count(0) from `incidentes` where (`incidentes`.`idincidentes` = `a`.`incidentes_idincidentes`)) > 0)) order by `a`.`data` desc;

