DROP TABLE IF EXISTS `listcomiss`;

CREATE ALGORITHM=UNDEFINED DEFINER=`vodanettel_4`@`%` SQL SECURITY DEFINER VIEW `listcomiss` AS select `i`.`os_idos` AS `idos`,`i`.`idinstalacoes` AS `idinstalacoes`,`i`.`nome` AS `vsat`,`u`.`nome` AS `tecnico`,`i`.`create_user_comiss_time` AS `data_inicio`,(select if(((`i`.`data_final_comiss` = '0000-00-00 00:00:00') or isnull(`i`.`data_final_comiss`)),'',`i`.`data_final_comiss`)) AS `data_fim`,(select (to_days(`i`.`data_aceite`) - to_days(`i`.`create_user_comiss_time`))) AS `tempo`,`i`.`comiss` AS `comiss`,(select if((`i`.`comiss` = 1),(select if((`i`.`test_e_termo_aceite` = 1),'Finalizado','Em Andamento')),'Inexistente')) AS `status`,(select `usuarios`.`perfis_idperfis` from `usuarios` where (`usuarios`.`idusuarios` = `i`.`create_user_comiss`)) AS `idperfil_usuario`,(select timediff(if((isnull(`i`.`data_final_comiss`) or (`i`.`data_final_comiss` = '0000-00-00 00:00:00')),now(),`i`.`data_final_comiss`),`i`.`create_user_comiss_time`)) AS `tempo_vencimento` from (`instalacoes` `i` left join `usuarios` `u` on((`u`.`idusuarios` = `i`.`create_user_comiss`)));

