CREATE ALGORITHM=UNDEFINED DEFINER=`vodanettel_4`@`%` SQL SECURITY DEFINER VIEW `listequipamentos` AS select `e`.`idequipamentos` AS `idequipamentos`,`te`.`nome` AS `nome_tipo_equipamentos`,`e`.`sno` AS `sno`,`e`.`mac` AS `mac`,(select if((`e`.`status` = 1),'Disponível','Em uso')) AS `status`,`e`.`local` AS `local`,`e`.`vsat` AS `vsat`,concat(substr(`e`.`observacoes`,1,50),'...') AS `observacoes` from (`equipamentos` `e` left join `tipo_equipamentos` `te` on((`te`.`idtipo_equipamentos` = `e`.`tipo_equipamentos_idtipo_equipamentos`)));

