DROP TABLE IF EXISTS `listincidentes`;

CREATE ALGORITHM=UNDEFINED DEFINER=`vodanettel_4`@`%` SQL SECURITY DEFINER VIEW `listincidentes` AS select `inci`.`idincidentes` AS `idincidentes`,`inst`.`nome` AS `instalacoes_nome`,`inci`.`data` AS `data`,`inci`.`prioridade` AS `prioridade`,concat(substr(`inci`.`descricao`,1,50),'...') AS `descricao`,concat(substr(`atend`.`atendimento`,1,50),'...') AS `atendimento`,`inci`.`idprodemge` AS `idprodemge`,(select if(((select count(0) from `atend_vsat` `atend2` where ((`atend2`.`status_atend_idstatus_atend` = 1) and (`inci`.`idincidentes` = `atend2`.`incidentes_idincidentes`))) > 0),'Aberto',(select if(((select count(0) from `atend_vsat` `atend3` where ((`atend3`.`status_atend_idstatus_atend` = 2) and (`inci`.`idincidentes` = `atend3`.`incidentes_idincidentes`))) > 0),'Em Atendimento',(select if(((select count(0) from `atend_vsat` `atend4` where ((`atend4`.`status_atend_idstatus_atend` = 3) and (`inci`.`idincidentes` = `atend4`.`incidentes_idincidentes`))) > 0),'Finalizado','Sem Atendimento')))))) AS `status`,`u`.`nome` AS `nomeTecnico` from (((`incidentes` `inci` left join `atend_vsat` `atend` on((`atend`.`idatend_vsat` = `inci`.`atend_vsat_idatend_vsat`))) left join `usuarios` `u` on((`inci`.`tecnicoNoc` = `u`.`idusuarios`))) left join `instalacoes` `inst` on((`inci`.`instalacoes_idinstalacoes` = `inst`.`idinstalacoes`)));

