CREATE ALGORITHM=UNDEFINED DEFINER=`vodanettel_4`@`%` SQL SECURITY DEFINER VIEW `listinstalacoes` AS select `i`.`idinstalacoes` AS `idinstalacoes`,`i`.`nome` AS `nome`,`o`.`numOS` AS `numos`,`o`.`empresas_idempresas` AS `empresa`,`i`.`mac` AS `mac`,`i`.`cod_anatel` AS `cod_anatel`,(select if(`i`.`webnms`,(select if(`i`.`packetshapper`,(select if(`i`.`reglicenca`,'Completa','Pendente Registro a Licença')),'Pendente Packet Shapper')),'Pendente WebNms')) AS `status`,(select if((`i`.`comiss` <> 1),'Não','Sim')) AS `comiss`,(select if(`i`.`data_aceite`,`i`.`data_aceite`,'Não')) AS `aceite_prodemge` from (`instalacoes` `i` left join `os` `o` on((`o`.`idos` = `i`.`os_idos`)));

