--
-- Estrutura para visualizar `listos`
--
DROP TABLE IF EXISTS `listos`;

CREATE ALGORITHM=UNDEFINED DEFINER=`vodanettel_4`@`%` SQL SECURITY DEFINER VIEW `listos` AS select `m`.`municipio` AS `municipios_municipio`,`m`.`macroregiao` AS `municipios_macroregiao`,`o`.`idos` AS `os_idos`,`o`.`numOS` AS `os_numOS`,`o`.`dataSolicitacao` AS `os_dataSolicitacao`,`o`.`prazoInstal` AS `os_prazoInstal`,`o`.`identificador` AS `identificador`,`o`.`empresas_idempresas` AS `empresa`,(select `empresas`.`empresa` from `empresas` where (`empresas`.`idempresas` = `o`.`empresas_idempresas`)) AS `os_empresas_idempresas`,`ag`.`mac` AS `agenda_instal_mac`,`ag`.`idagenda_instal` AS `agenda_instal_idagenda_instal`,`ag`.`confirm` AS `agenda_instal_confirm`,`i`.`idinstalacoes` AS `instalacoes_idinstalacoes`,`i`.`webnms` AS `instalacoes_webnms`,`i`.`packetshapper` AS `instalacoes_packetshapper`,`i`.`reglicenca` AS `instalacoes_reglicenca`,`i`.`opmanager` AS `instalacoes_opmanager`,`i`.`test_prtg` AS `instalacoes_prtg`,`i`.`comiss` AS `instalacoes_comiss`,`i`.`cod_anatel` AS `instalacoes_cod_anatel`,`i`.`data_aceite` AS `instalacoes_data_aceite`,`i`.`nome` AS `instalacoes_vsat`,(select if(`agenda_instal_idagenda_instal`,(select if((`agenda_instal_confirm` = 1),'Confirmado',(select if(`agenda_instal_mac`,'Agendado',(select concat('Agendado mac: ',`agenda_instal_mac`)))))),'Não')) AS `agendamento`,(select if((`i`.`comiss` = 1),(select if((`i`.`test_e_termo_aceite` = 1),'Finalizado','Em Andamento')),'Não')) AS `comiss`,(select if(`instalacoes_idinstalacoes`,(select if(((`instalacoes_packetshapper` <> 1) or isnull(`instalacoes_packetshapper`)),'Pendente Packet Shapper',(select if(((`instalacoes_webnms` <> 1) or isnull(`instalacoes_webnms`)),'Pendente WebNms',(select if(((`instalacoes_reglicenca` <> 1) or isnull(`instalacoes_reglicenca`)),'Pendente Registro da licença',(select if(((`instalacoes_opmanager` <> 1) or isnull(`instalacoes_opmanager`)),'Pendente Opmanager',(select if(((`instalacoes_prtg` <> 1) or isnull(`instalacoes_prtg`)),'Pendente PRTG','Completa')))))))))),'Não')) AS `vsatCriada`,(select if(`instalacoes_idinstalacoes`,(select if(`instalacoes_cod_anatel`,`instalacoes_cod_anatel`,'Não')),'Não')) AS `codAnatel`,cast((select if(`instalacoes_data_aceite`,(select if(`instalacoes_data_aceite`,`instalacoes_data_aceite`,'Não')),'Não')) as char charset utf8) AS `aceiteProdemge`,(select if(((select count(`pausas`.`idpausas`) from `pausas` where ((`pausas`.`tabela` = 'OS') and (`pausas`.`chaveextrangeira` = `o`.`idos`) and isnull(`pausas`.`pausa_fim`))) > 0),'Sim','Não')) AS `paralisado` from (((`os` `o` left join `instalacoes` `i` on((`i`.`os_idos` = `o`.`idos`))) left join `municipios` `m` on((`o`.`municipios_idcidade` = `m`.`idmunicipios`))) left join `agenda_instal` `ag` on((`ag`.`os_idos` = `o`.`idos`))) order by `i`.`data_aceite` desc;

